            public void InsertTable(OXSimpleWordTable t)
            {
                Table table1 = new Table();

                TableProperties tableProperties1 = new TableProperties();
                TableStyle tableStyle1 = new TableStyle() { Val = "a7" };

                int tWidth =  t.ColumnsOptions.Select(x=>Convert.ToInt32(x.Width)).Sum();
                TableWidth tableWidth1 = new TableWidth() { Width = tWidth.ToString(), Type = TableWidthUnitValues.Dxa };

                BorderValues bv = BorderValues.None;
                if (t.Border == 1) bv = BorderValues.Single;

                TableBorders tableBorders1 = new TableBorders();
                TopBorder topBorder1 = new TopBorder() { Val = bv, Color = "auto", Size = (UInt32Value)0U, Space = (UInt32Value)0U };
                LeftBorder leftBorder1 = new LeftBorder() { Val = bv, Color = "auto", Size = (UInt32Value)0U, Space = (UInt32Value)0U };
                BottomBorder bottomBorder1 = new BottomBorder() { Val = bv, Color = "auto", Size = (UInt32Value)0U, Space = (UInt32Value)0U };
                RightBorder rightBorder1 = new RightBorder() { Val = bv, Color = "auto", Size = (UInt32Value)0U, Space = (UInt32Value)0U };
                InsideHorizontalBorder insideHorizontalBorder1 = new InsideHorizontalBorder() { Val = bv, Color = "auto", Size = (UInt32Value)0U, Space = (UInt32Value)0U };
                InsideVerticalBorder insideVerticalBorder1 = new InsideVerticalBorder() { Val = bv, Color = "auto", Size = (UInt32Value)0U, Space = (UInt32Value)0U };

                //!!TableIndentation tableIndentation1 = new TableIndentation() { Width = -72, Type = TableWidthUnitValues.Dxa };
                TableIndentation tableIndentation1 = new TableIndentation() { Width = 0, Type = TableWidthUnitValues.Dxa };


                tableBorders1.Append(topBorder1);
                tableBorders1.Append(leftBorder1);
                tableBorders1.Append(bottomBorder1);
                tableBorders1.Append(rightBorder1);
                tableBorders1.Append(insideHorizontalBorder1);
                tableBorders1.Append(insideVerticalBorder1);

                TableLook tableLook1 = new TableLook() { Val = "04A0" };

                tableProperties1.Append(tableStyle1);
                tableProperties1.Append(tableWidth1);
                tableProperties1.Append(tableBorders1);
                tableProperties1.Append(tableLook1);

                TableGrid tableGrid1 = new TableGrid();

                List<GridColumn> gridColumns = new List<GridColumn>();
                gridColumns = t.ColumnsOptions.Select(x => new GridColumn { Width = x.Width }).ToList();

                foreach (var gr in gridColumns) tableGrid1.Append(gr);

                table1.Append(tableProperties1);
                table1.Append(tableGrid1);

                foreach (OXSimpleWordTableRow row in t.Rows)
                {
                    TableRow tableRow1 = new TableRow() { RsidTableRowAddition = "00950BA7", RsidTableRowProperties = "00950BA7" };
                    TableRowProperties tableRowProperties1 = new TableRowProperties();
                    CantSplit cantSplit1 = new CantSplit();
                    tableRowProperties1.Append(cantSplit1);

                    int index = 0;
                    foreach (OXSimpleWordTableCell cell in row.Cells)
                    {
                        string cellWidth = (cell.Width == string.Empty) ?  t.ColumnsOptions.Select(x=>x.Width).Skip(index++).Take(1).First() : cell.Width;

                        TableCell tableCell1 = new TableCell();

                        TableCellProperties tableCellProperties1 = new TableCellProperties();
                        TableCellWidth tableCellWidth1 = new TableCellWidth() { Width = cellWidth, Type = TableWidthUnitValues.Dxa };
                        if (cell.VerticalMerge != OXSimpleWordTableCellVerticalMerge.None)
                        {
                            VerticalMerge verticalMerge1 = new VerticalMerge() { Val = cell.VerticalMerge == OXSimpleWordTableCellVerticalMerge.Restart ? MergedCellValues.Restart : MergedCellValues.Continue };
                            tableCellProperties1.Append(verticalMerge1);
                        }
                        if (cell.Borders != OXSimpleWordTableCellBorders.All)
                        {
                            TableCellBorders tableCellBorders1 = new TableCellBorders();
                            switch (cell.Borders)
                            {
                                case OXSimpleWordTableCellBorders.NoBottom:
                                    BottomBorder bottomBord1 = new BottomBorder() { Val = BorderValues.Nil };
                                    tableCellBorders1.Append(bottomBord1);
                                    break;
                                case OXSimpleWordTableCellBorders.NoLeft:
                                    LeftBorder leftBord1 = new LeftBorder() { Val = BorderValues.Nil };
                                    tableCellBorders1.Append(leftBord1);
                                    break;
                                case OXSimpleWordTableCellBorders.NoTop:
                                    TopBorder topBord1 = new TopBorder() { Val = BorderValues.Nil };
                                    tableCellBorders1.Append(topBord1);
                                    break;
                                case OXSimpleWordTableCellBorders.NoRight:
                                    RightBorder rightBord1 = new RightBorder() { Val = BorderValues.Nil };
                                    tableCellBorders1.Append(rightBord1);
                                    break;
                                case OXSimpleWordTableCellBorders.None:
                                    BottomBorder bottomBord11 = new BottomBorder() { Val = BorderValues.Nil };
                                    tableCellBorders1.Append(bottomBord11);
                                    LeftBorder leftBord11 = new LeftBorder() { Val = BorderValues.Nil };
                                    tableCellBorders1.Append(leftBord11);
                                    TopBorder topBord11 = new TopBorder() { Val = BorderValues.Nil };
                                    tableCellBorders1.Append(topBord11);
                                    RightBorder rightBord11 = new RightBorder() { Val = BorderValues.Nil };
                                    tableCellBorders1.Append(rightBord11);
                                    break;
                            }
                            tableCellProperties1.Append(tableCellBorders1);
                        }

                        if (cell.GridSpan > 0)
                        {
                            GridSpan gridSpan1 = new GridSpan() { Val = cell.GridSpan };
                            tableCellProperties1.Append(gridSpan1);
                        }

                        tableCellProperties1.Append(tableCellWidth1);

                        string [] sr = cell.Value.Split('&');
                        foreach (string a in sr)
                        {
                            Paragraph _paragraph = new Paragraph() { RsidParagraphAddition = "00950BA7", RsidParagraphProperties = "00950BA7", RsidRunAdditionDefault = "00950BA7" };
                            ParagraphProperties paragraphProperties1 = new ParagraphProperties();
                            SpacingBetweenLines spacingBetweenLines1 = new SpacingBetweenLines() { Line = cell.spacingBetweenLines, LineRule = LineSpacingRuleValues.Exact };  //
                            paragraphProperties1.Append(spacingBetweenLines1);

                            Run run1 = new Run() { RsidRunProperties = "00950BA7" };
                            Text text1 = new Text();
                            text1.Text = a;


                            RunProperties runProperties1 = new RunProperties();
                            FontSize fontSize2 = new FontSize() { Val = cell.FontSize };
                            FontSizeComplexScript fontSizeComplexScript2 = new FontSizeComplexScript() { Val = cell.FontSize };
                            Languages languages2 = new Languages() { Val = "en-US" };

                            if (cell.Bold > 0)
                            {
                                runProperties1.Append(new Bold());
                            }


                            //RunFonts runFonts2 = new RunFonts() { Ascii = "Times New Roman", HighAnsi = "Times New Roman", ComplexScript = "Times New Roman" };
                            RunFonts runFonts2 = new RunFonts() { Ascii = "Arial", HighAnsi = "Arial", ComplexScript = "Arial" }; //TODO
                            runProperties1.Append(runFonts2);

                            runProperties1.Append(fontSize2);
                            runProperties1.Append(fontSizeComplexScript2);
                            //runProperties1.Append(languages2);

                            run1.Append(runProperties1);
                            run1.Append(text1);

                            //JustificationValues val_aligment = cell.justification;
                            Justification justification1 = new Justification() { Val = cell.justification };// val_aligment };

                            paragraphProperties1.Append(justification1);
                            _paragraph.Append(paragraphProperties1);
                            _paragraph.Append(run1);
                            tableCell1.Append(_paragraph);
                        }
                        tableCell1.Append(tableCellProperties1);
                        tableRow1.Append(tableCell1);
                    }

                    tableRow1.Append(tableRowProperties1);

                    //GridAfter gridAfter1 = new GridAfter() { Val = 1 };
                    //WidthAfterTableRow widthAfterTableRow1 = new WidthAfterTableRow() { Width = "2030", Type = TableWidthUnitValues.Dxa };
                    //////CantSplit cantSplit1 = new CantSplit();
                    //tableRowProperties1.Append(gridAfter1);
                    //tableRowProperties1.Append(widthAfterTableRow1);

                    table1.Append(tableRow1);
                }

                body.Append(table1);
                paragraph1 = null;
            }



            public void AddTable(TStyle tstyle, List<string[]> table)
            {
                Table table1 = new Table();

                TableProperties tableProperties1 = new TableProperties();
                TableStyle tableStyle1 = new TableStyle() { Val = "a7" };
                TableWidth tableWidth1 = new TableWidth() { Width = "9720", Type = TableWidthUnitValues.Dxa };
                TableWidth tableWidth2 = new TableWidth() { Width = "9470", Type = TableWidthUnitValues.Dxa };

                TableBorders tableBorders1 = new TableBorders();
                TopBorder topBorder1 = new TopBorder() { Val = BorderValues.None, Color = "auto", Size = (UInt32Value)0U, Space = (UInt32Value)0U };
                LeftBorder leftBorder1 = new LeftBorder() { Val = BorderValues.None, Color = "auto", Size = (UInt32Value)0U, Space = (UInt32Value)0U };
                BottomBorder bottomBorder1 = new BottomBorder() { Val = BorderValues.None, Color = "auto", Size = (UInt32Value)0U, Space = (UInt32Value)0U };
                RightBorder rightBorder1 = new RightBorder() { Val = BorderValues.None, Color = "auto", Size = (UInt32Value)0U, Space = (UInt32Value)0U };
                InsideHorizontalBorder insideHorizontalBorder1 = new InsideHorizontalBorder() { Val = BorderValues.None, Color = "auto", Size = (UInt32Value)0U, Space = (UInt32Value)0U };
                InsideVerticalBorder insideVerticalBorder1 = new InsideVerticalBorder() { Val = BorderValues.None, Color = "auto", Size = (UInt32Value)0U, Space = (UInt32Value)0U };
                TableIndentation tableIndentation1 = new TableIndentation() { Width = -72, Type = TableWidthUnitValues.Dxa };
                

                tableBorders1.Append(topBorder1);
                tableBorders1.Append(leftBorder1);
                tableBorders1.Append(bottomBorder1);
                tableBorders1.Append(rightBorder1);
                tableBorders1.Append(insideHorizontalBorder1);
                tableBorders1.Append(insideVerticalBorder1);
                TableLook tableLook1 = new TableLook() { Val = "04A0" };

                tableProperties1.Append(tableStyle1);
                if (tstyle == TStyle.TSTYLE_2) tableProperties1.Append(tableWidth2);
                else tableProperties1.Append(tableWidth1);
                tableProperties1.Append(tableBorders1);
                tableProperties1.Append(tableLook1);

                TableGrid tableGrid1 = new TableGrid();

                GridColumn gridColumn1 = null, gridColumn2 = null;
                switch (tstyle)
                {
                    case TStyle.TSTYLE_1:
                        gridColumn1 = new GridColumn() { Width = "1668" };
                        gridColumn2 = new GridColumn() { Width = "7796" };
                        break;
                    case TStyle.TSTYLE_2:
                        gridColumn1 = new GridColumn() { Width = "6629" };
                        gridColumn2 = new GridColumn() { Width = "2691" };
                        break;
                    case TStyle.TSTYLE_3:
                        gridColumn1 = new GridColumn() { Width = "3240" };
                        gridColumn2 = new GridColumn() { Width = "6480" };
                        break;
                    case TStyle.TSTYLE_4:
                        gridColumn1 = new GridColumn() { Width = "6000" };
                        gridColumn2 = new GridColumn() { Width = "3720" };
                        break;
                }
                tableGrid1.Append(gridColumn1);
                tableGrid1.Append(gridColumn2);

                table1.Append(tableProperties1);
                table1.Append(tableGrid1);

                foreach (string [] val in table)
                {

                    TableRow tableRow1 = new TableRow() { RsidTableRowAddition = "00950BA7", RsidTableRowProperties = "00950BA7" };
                    //@#$
                    TableRowProperties tableRowProperties1 = new TableRowProperties();
                    CantSplit cantSplit1 = new CantSplit();
                    tableRowProperties1.Append(cantSplit1);

                    bool ord = true;
                    foreach (string s in val)
                    {
                        string cellWidth = string.Empty;
                        switch (tstyle)
                        {
                            case TStyle.TSTYLE_1: cellWidth = ord ? "1668" : "7796"; break;
                            case TStyle.TSTYLE_2: cellWidth = ord ? "6629" : "2691"; break;
                            case TStyle.TSTYLE_3: cellWidth = ord ? "3240" : "6480"; break;
                            case TStyle.TSTYLE_4: cellWidth = ord ? "6000" : "3720"; break;
                        }
                        ord = !ord;
                        TableCell tableCell1 = new TableCell();

                        TableCellProperties tableCellProperties1 = new TableCellProperties();
                        TableCellWidth tableCellWidth1 = new TableCellWidth() { Width = cellWidth, Type = TableWidthUnitValues.Dxa };
                        tableCellProperties1.Append(tableCellWidth1);

                        string[] sr = s.Split('&');
                        foreach (string a in sr)
                        {
                            Paragraph _paragraph = new Paragraph() { RsidParagraphAddition = "00950BA7", RsidParagraphProperties = "00950BA7", RsidRunAdditionDefault = "00950BA7" };
                            ParagraphProperties paragraphProperties1 = new ParagraphProperties();
                            SpacingBetweenLines spacingBetweenLines1 = new SpacingBetweenLines() { Line = "240", LineRule = LineSpacingRuleValues.Exact };  //
                            paragraphProperties1.Append(spacingBetweenLines1);

                            Run run1 = new Run() { RsidRunProperties = "00950BA7" };
                            Text text1 = new Text();
                            text1.Text = a;

                            run1.Append(text1);

                            JustificationValues val_aligment = ord ? JustificationValues.Both : JustificationValues.Left;
                            if (tstyle == TStyle.TSTYLE_2 && ord) val_aligment = JustificationValues.Right;

                            Justification justification1 = new Justification() { Val = val_aligment };

                            paragraphProperties1.Append(justification1);
                            _paragraph.Append(paragraphProperties1);
                            _paragraph.Append(run1);
                            tableCell1.Append(_paragraph);
                        }
                        tableCell1.Append(tableCellProperties1);

                        tableRow1.Append(tableCell1);
                    }
                    //@#$
                    tableRow1.Append(tableRowProperties1);
                    table1.Append(tableRow1);
                }
                body.Append(table1);
                paragraph1 = null;

            }

