            /// <summary>
            /// установить значение текущего параграфа и вставить в документ
            /// </summary>
            /// <param name="aligment">выравнивание</param>
            /// <param name="interval">межстрочный интервал</param>            
            /// <param name="red_row">0-нет, 1-признак красной строки,2-отступ с 9см</param>
            public Paragraph SetParagraph(Aligment aligment = Aligment.LEFT, Interval interval = Interval.INT_1, int red_row = 1)
            {   
                option_pg.aligment = aligment;
                option_pg.interval = interval;
                option_pg.red_row = red_row;

                JustificationValues val_aligment = JustificationValues.Left;
                switch (aligment)
                {
                    case Aligment.CENTER: val_aligment = JustificationValues.Center; break;
                    case Aligment.LEFT: val_aligment = JustificationValues.Left; break;
                    case Aligment.WIDTH: val_aligment = JustificationValues.Both; break;
                    case Aligment.RIGHT: val_aligment = JustificationValues.Right; break;
                }
                paragraph1 = new Paragraph() { RsidParagraphMarkRevision = "00886754", RsidParagraphAddition = "00A06935", RsidParagraphProperties = "00A06935", RsidRunAdditionDefault = "00A06935" };                
                if (red_row == 1) paragraph1 = new Paragraph() { RsidParagraphAddition = "007E7961", RsidParagraphProperties = "007E7961", RsidRunAdditionDefault = "007E7961" };
                else if (red_row == 2) paragraph1 = new Paragraph() { RsidParagraphAddition = "00866773", RsidParagraphProperties = "00412063", RsidRunAdditionDefault = "00412063" };                

                ParagraphProperties paragraphProperties1 = new ParagraphProperties();
                ///SuppressAutoHyphens suppressAutoHyphens1 = new SuppressAutoHyphens();
                Shading shading1 = new Shading() { Val = ShadingPatternValues.Clear, Color = "auto", Fill = "FFFFFF" };
                SpacingBetweenLines spacingBetweenLines1 = new SpacingBetweenLines() { Line = "300", LineRule = LineSpacingRuleValues.Exact };
                switch (interval)
                {
                    case Interval.INT_1: spacingBetweenLines1.Line = "320"; break;
                    case Interval.INT_15: spacingBetweenLines1.Line = "360"; break;
                    case Interval.INT_2: spacingBetweenLines1.Line = "480"; break;
                    case Interval.INT_POINT_14pt: spacingBetweenLines1.Line = "280"; break;
                    case Interval.INT_POINT_12pt: spacingBetweenLines1.Line = "240"; break;
                    case Interval.INT_POINT_10pt: spacingBetweenLines1.Line = "200"; break;
                }
                Indentation indentation1 = new Indentation();
                //indentation1 = new Indentation() { Left = FirstLine, Right = FirstLine };
                if (red_row == 1) indentation1 = new Indentation() { FirstLine = FirstLine };
                else if (red_row == 2) indentation1 = new Indentation() { FirstLine = FirstLine9 };
                
                Justification justification1 = new Justification() { Val = val_aligment };

                ParagraphMarkRunProperties paragraphMarkRunProperties1 = new ParagraphMarkRunProperties();
                Bold bold1 = new Bold();

                paragraphMarkRunProperties1.Append(bold1);

                ///paragraphProperties1.Append(suppressAutoHyphens1);
                paragraphProperties1.Append(shading1);
                paragraphProperties1.Append(spacingBetweenLines1);
                paragraphProperties1.Append(indentation1);
                paragraphProperties1.Append(justification1);
                paragraphProperties1.Append(paragraphMarkRunProperties1);

                paragraph1.Append(paragraphProperties1);
                return paragraph1;
            }







