            /// добавить текст параграф
            /// </summary>
            /// <param name="text"></param>
            /// <param name="bold"></param>
            /// <param name="end">при true - добавлятеся текущий параграф в док</param>
            public void AddText(string text = "", bool bold = false, bool end = true, int font = 0, string fontname = "Arial")
            {
                Run run1 = new Run();
                RunProperties runProperties1 = new RunProperties();

                if (font > 0)
                {
                    FontSize fontSize1 = new FontSize() { Val = font.ToString() };
                    runProperties1.Append(fontSize1);
                }

                if (bold == true)
                {
                    runProperties1.Append(new Bold());
                }

                RunFonts runFonts1 = new RunFonts() { Ascii = fontname, HighAnsi = fontname, ComplexScript = fontname };
                runProperties1.Append(runFonts1);

                Text text1 = new Text();
                if (end) text1 = new Text() { Space = SpaceProcessingModeValues.Preserve };
                text1.Text = text;

                run1.Append(runProperties1);
                run1.Append(text1);

                if (paragraph1 == null) SetParagraph(option_pg.aligment, option_pg.interval, option_pg.red_row);

                paragraph1.Append(run1);
                if (end && paragraph1 != null && body != null)
                {
                    body.Append(paragraph1);
                    paragraph1 = null;
                }
            }

