        // Creates an Document instance and adds its children.
        public string GenerateDocument(string folder_name, string file_name, OXSimpleWordOptions word_opts)
            {
                if (body == null) return "";
                
                string fileName = String.Format("{0}\\{1}", folder_name, file_name);

                using (var package = WordprocessingDocument.Create(fileName, WordprocessingDocumentType.Document))
                {
                    MainDocumentPart dp = package.AddMainDocumentPart();
                    dp.Document = new DocumentFormat.OpenXml.Wordprocessing.Document();

                    CreateMainDocumentPart(dp, word_opts);

                    package.MainDocumentPart.Document.Save();

                }
                return fileName;
            }

            // Adds child parts and generates content of the specified part.
            protected void CreateMainDocumentPart(MainDocumentPart part, OXSimpleWordOptions word_opts)
            {
                WebSettingsPart webSettingsPart1 = part.AddNewPart<WebSettingsPart>("rId3");
                GenerateWebSettingsPart1Content(webSettingsPart1);

                DocumentSettingsPart documentSettingsPart1 = part.AddNewPart<DocumentSettingsPart>("rId2");
                GenerateDocumentSettingsPart1Content(documentSettingsPart1);

                StyleDefinitionsPart styleDefinitionsPart1 = part.AddNewPart<StyleDefinitionsPart>("rId1");
                GenerateStyleDefinitionsPart1Content(styleDefinitionsPart1);

                ThemePart themePart1 = part.AddNewPart<ThemePart>("rId5");
                GenerateThemePart1Content(themePart1);

                FontTablePart fontTablePart1 = part.AddNewPart<FontTablePart>("rId4");
                GenerateFontTablePart1Content(fontTablePart1);

                HeaderPart headerPart1 = part.AddNewPart<HeaderPart>("rId8");
                GenerateHeaderPart1Content(headerPart1);

                ImagePart imagePart1 = part.AddNewPart<ImagePart>("image/png", "rId6");
                GenerateImagePart1Content(imagePart1, 1);

                ImagePart imagePart2 = part.AddNewPart<ImagePart>("image/png", "rId7");
                GenerateImagePart1Content(imagePart2, 2);

                ImagePart imagePart3 = part.AddNewPart<ImagePart>("image/png", "rId9");
                GenerateImagePart1Content(imagePart3, 3);

                ImagePart imagePart4 = part.AddNewPart<ImagePart>("image/png", "rId10");
                GenerateImagePart1Content(imagePart4, 4);


                GeneratePartContent(part, word_opts);
            }


